import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import './index.css';
import {Link} from 'react-router-dom';



function DeasTwoComponent() {
    return (
        <div>
             <Link to="/soft/one">
                <button className='b1'>
                Programming Tutorials
                </button>
            </Link>
            <Link to="/soft/two">
                <button className='b2'>
                Supporting Documentation
                </button>
            </Link>
            <Link to="/soft/three">
                <button className='b3'>
                Advanced Topics
                </button>
            </Link>
            <Link to="/soft/four">
                <button className='b3'>
                Vision Programming
                </button>
            </Link>
</div>


    );
}

export default DeasTwoComponent;
